import React from 'react';
import axios from 'axios';

const Login = () => {
  const googleResponse = (data) => {
    axios
      .post('http://localhost:8001/api/auth/google', data)
      .then((res) => console.log(res.data));
  };

  const onFailure = (err) => {
    console.log(err);
  };

  return (
    <GoogleLoginButton />
  );
};

export default Login;
